import React from 'react';
import classes from './About.module.css';

class About extends React.Component {
    render() {
        return (
            <div className={classes.About}>
                <div className={classes.Content}>
                    <h1>About Me</h1>
                    <p>Bio</p>
                    <p>My name is Alex Forest and I'm a primarily self-taught developer based in Long Beach, USA. My focus and interests include both front-end development and full-stack development. Some of my skills included in this portfolio include ASP.NET, C#, Bootstrap, JavaScript, CSS, and ReactJS, which was used to build this portfolio. </p>
                </div>
            </div>
        )
    }
}

export default About;
